            //  Log.v("linkUrl==", json.getString("linkUrl"));
            Log.v("title==", json.getString("title"));
            Log.v("description==", json.getString("description"));
            Log.v("imageBase64==", json.getString("imageBase64"));
            txtBirthday1 = (TextView) findViewById(R.id.textViewBirthday1);
            txtBirthday2 = (TextView) findViewById(R.id.textViewBirthday2);
            btnImageLogoBirthday = (Button) findViewById(R.id.imageLogoBirthday);
